import {Injectable} from '@angular/core';
import {_, PayloadModel, TqlApiLibService} from 'tql-service';
import {HttpClient, HttpHeaders} from '@angular/common/http';
import {MessageResponseModel} from '../model/message-response.model';
import {BehaviorSubject, from, Observable, of} from 'rxjs';
import {ConversationModel} from '../model/conversation.model';
import {DEFAULT_CONFIG} from '../const/value.const';
import {PAYLOADS} from '../const/payloads.const';

@Injectable({
  providedIn: 'root'
})
export class ChatDataService {
  conversationHistory$: BehaviorSubject<MessageResponseModel[]> = new BehaviorSubject<MessageResponseModel[]>([
    {
      isUser: true,
      content: [
        {
          content: 'Has there been a change in emissions since last year?',
          isImage: false
        }
      ]
    },
    {
      isUser: false,
      content: [
        {
          content: 'Let me pull some data so I can better address your question.',
          isImage: false
        },
        {
          content: 'data:image/png;base64,',
          isImage: true
        },
      ]
    },
    {
      isUser: true,
      content: [
        {
          content: 'Has there been a change in emissions since last year?',
          isImage: false
        }
      ]
    },
    {
      isUser: false,
      content: [
        {
          content: 'Generated response',
          isImage: false
        },
        {
          content: 'data:image/png;base64,',
          isImage: true
        },
        {
          content: 'data:image/png;base64,',
          isImage: true
        }
      ]
    }
  ]);
  config$: BehaviorSubject<any> = new BehaviorSubject<any>(_.cloneDeep(DEFAULT_CONFIG));
  collections$: BehaviorSubject<ConversationModel.IConversationCollection[]> = new BehaviorSubject<ConversationModel.IConversationCollection[]>([]);
  currentCollection$: BehaviorSubject<ConversationModel.IConversationCollection | null> = new BehaviorSubject<ConversationModel.IConversationCollection | null>(null);

  constructor(private _TqlApiLibService: TqlApiLibService,
              private _HttpClient: HttpClient) {

  }

  getDTX_DS_KEY() {
    return this.config$.value['DTX_DS_KEY'];
  }

  getBE_URL() {
    return this.config$.value['BE_URL'];
  }

  getSessionStatus() {
    return this._TqlApiLibService
      .get(`${this.getBE_URL()}/CheckWallyeeSession`, 'application/json', {'DTX-DS-KEY': this.getDTX_DS_KEY()})
      .then((rs: any) => {
        rs = JSON.parse(rs);
        console.log(rs);
        return rs;
      });
  }

  startSession(): Promise<ConversationModel.IConversationCollection | null> {
    return this._TqlApiLibService
      .post(new PayloadModel(PAYLOADS.StartWallyeeSession), [], {'DTX-DS-KEY': this.getDTX_DS_KEY()}, `${this.getBE_URL()}/StartWallyeeSession`)
      .then((rs: any) => {
        const conversation = new ConversationModel();
        let sessionId: string = '';
        if (_.get(rs, 'data.StartWallyeeSession.Status') === 'Success') {
          sessionId = _.get(rs, 'data.StartWallyeeSession.Results.SessionId') || '';
          conversation.id = sessionId;
          const message1: string = _.get(rs, 'data.StartWallyeeSession.Results.StarterMessage') || '';
          const message2: string = _.get(rs, 'data.StartWallyeeSession.Results.IcebreakerMessage') || '';
          if (message1) {
            conversation.addMessage(message1);
          }
          if (message2) {
            conversation.addMessage(message2);
          }
        }

        //save to local
        if (sessionId) {
          const collections: ConversationModel.IConversationCollection[] = this.collections$.value;
          collections.push({sessionId: sessionId, conversations: [conversation]});
          this.collections$.next(collections);
          this.saveCollectionsToLocal();
        }

        return sessionId ? {sessionId: sessionId, conversations: [conversation]} : null;
      });
  }

  stopSession(sessionId: string) {
    return this._TqlApiLibService
      .post(new PayloadModel(PAYLOADS.StopWallyeeSession), [sessionId], {'DTX-DS-KEY': this.getDTX_DS_KEY()}, `${this.getBE_URL()}/StopWallyeeSession`)
      .then((rs: any) => {
        console.log(rs);
        this.currentCollection$.next(null);
        return rs;
      });
  }

  chatWithWallyee(sessionId: string, message: string) {
    return this._TqlApiLibService
      .post(new PayloadModel(PAYLOADS.ChatWithWallyee), [sessionId, message], {'DTX-DS-KEY': this.getDTX_DS_KEY()}, `${this.getBE_URL()}/ChatWithWallyee`)
      .then((rs: any) => {
        if (_.get(rs, 'data.ChatWithWallyee.Status') === 'Success') {
          const responseChat = _.get(rs, 'data.ChatWithWallyee.Results.ChatConversation') || '';
          return {
            responseId: responseChat['Id'],
            message: message,
            response: responseChat['ChatResponse']
          }
        }
        return false;
      });
  }

  saveCollectionsToLocal() {
    const collections: ConversationModel.IConversationCollection[] = this.collections$.value;
    console.log(ConversationModel.unparseCollections(collections));
    localStorage.setItem(DEFAULT_CONFIG.LOCALSTORAGE_COLLECTION_KEY, JSON.stringify(ConversationModel.unparseCollections(collections)));
  }

  loadCollectionsFromLocal() {
    const collections: ConversationModel.IConversationCollection[] = JSON.parse(localStorage.getItem(DEFAULT_CONFIG.LOCALSTORAGE_COLLECTION_KEY) || '[]');
    console.log(ConversationModel.parseCollections(collections));
    this.collections$.next(ConversationModel.parseCollections(collections));
  }

  clearCollectionsFromLocal() {
    localStorage.removeItem(DEFAULT_CONFIG.LOCALSTORAGE_COLLECTION_KEY);
  }

  getCurrentConversationData$(): Observable<MessageResponseModel[]> {
    return this.conversationHistory$.asObservable();
  }

  getConversationData() {
    return new Promise((resolve) => {
      resolve(this.conversationHistory$.value);
    }).then((data: unknown) => {
      const array: ConversationModel[] = [];
      _.forEach(data as any[], x => {
        array.push(new ConversationModel(x as any));
      })
      return array;
    })
  }

  getAllESs() {
    return this._TqlApiLibService
      .get('http://ctxdev.atomiton.com:8080/fid-carbonapi/ctx/v1/GetAllESs', 'application/json', {'DTX-DS-KEY': this.getDTX_DS_KEY()})
      .then((rs: any) => {
        console.log(rs);
        return rs;
      });
  }

  createNewConversation() {
    this.onRefreshSession();
  }

  onRefreshSession() {
    let promise = Promise.resolve();
    if (this.currentCollection$?.value) {
      promise = this.stopSession(this.currentCollection$.value.sessionId);
    }
    promise.then(() => {
      this.startSession().then((rs: any) => {
        this.currentCollection$.next(rs);
      });
    });
  }

  async sendMessage(chatMessage: string) {
    if (this.currentCollection$.value) {
      let rs = await this.chatWithWallyee(this.currentCollection$.value.sessionId, chatMessage);
      console.log(rs);
      if (rs) {
        // update collection
        const collection = this.currentCollection$.value;
        if (collection) {
          const userConversation = new ConversationModel({messages: [{content: rs?.message}], isUser: true});
          const wallyConversation = new ConversationModel({
            messages: [{content: rs?.response, id: rs?.responseId}],
            isUser: false
          });
          collection.conversations.push(userConversation);
          collection.conversations.push(wallyConversation);
          console.log(collection);
        }
        return true;
      }
    }
    return false;
  }
}
